llname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391240000535904105";}i:131;a:1:{s:10:"short_code";s:11:"CEvZBx0pb9p";}i:132;a:1:{s:12:"created_time";i:1599278043;}i:133;a:1:{s:7:"caption";s:2255:"MILESTONE

I’ve been working with the pup for weeks now, on ‘tethered decompression’ and ‘place’. He’s been ok but it’s been a challenge at home because he can’t seem to quite get the idea of staying in place and doing nothing. 

A few days ago, I tested him at a mamak stall. he was ok but still a little jumpy. 

Yesterday was his big test. We went out to a dog friendly pub (shout-out to @tomdickandharrys_malaysia ❤️). I gave him his ‘place’ and tethered him. He was a little anxious and reactive at first as it was his first time out to a place like this with so many people and noise. Gave him one of his favourite chew treats (Duck Neck by @quandogtreats - of course!) and as he chewed, he slowly began to calm down. 

When he was done I thought he would be his jumpy self. But he wasn’t. He stayed mostly in place, only reacting to a cat, not people. When he realised we weren’t going anywhere for a while he settled down to wait. At times on his mat. At times under my chair. I didn’t mind him moving as long as he didn’t try to get away or pull and choke himself, which he didn’t. Other patrons wouldn’t have even noticed him. 

I did treat him but only occasionally. He didn’t really need it. At one point he fell asleep. We were there about 3 hours and he was good almost the whole time. 

Today, after his walk, I tethered him at home for about 10 min. He quickly settled down unlike before. It’s almost as if a lightbulb has come on for him and he finally understands tethered decompression. He knows we’re not going anywhere & he just has to settle and do nothing. We’ll work on duration at home next before throwing him in the deep end as I did. 

I won’t take him to dog cafes. We tried once. I don’t like places like that and neither does he Cos he likes to play and not all dogs (and owners) understand his exuberance. So he’ll play with his friends who do. At other times, we’ll go for drinks and perhaps to other dog friendly human eating places (tell me of others if they exist!). 

